script: |
  super -f text -I q7590.spq | sort > q7590.out

inputs:
  - name: q7590.spq
    data: |
      SELECT DISTINCT + ( + + CAST ( NULL AS INTEGER ) ) - - col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + - col0 + - 20 + + - 40 + - col0 * + 63 IS NOT NULL;
  - name: tab2

outputs:
  - name: q7590.out
    data: |
